const AlbumPhotos = data =>{

    return (
        Object.keys(data).forEach(element => {
           return (
               `<div><h1>${element.title}</h1><img src="${element.thumbnailUrl} alt="image"/>  </div>`
                )
        })
    )

}

export default AlbumPhotos
